import "./Header.css"

function SearchBar() { 
  return (
    <React.Fragment>
      <form id = "form">
        <div class = "searchBar">

        </div>
        <input type = "search" 
        id = "query" 
        name = "q"
        placeholder="Search your past trips"/>
        <button>Search</button>
      </form>
    </React.Fragment>
  )
}

export default SearchBar;
